import React from "react";
import "./we-shop-button.scss";
function WeShopButton(props) {
  return (
    <div
      className={
        "button-container" + this.props.secondery - button
          ? "secondery-button"
          : ""
      }
    >
      <button className="button" onClick={props.onClick}>
        {props.text}
      </button>
    </div>
  );
}
export default WeShopButton;
